import './index.css';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'; 

function Header() {
  return (
    <div className="Header">
    <header class="p-3 text-bg-dark">
        <div class="container">
        <div class="d-flex flex-wrap align-items-center justify-content-center justify-content-lg-start">
         

            <ul class="nav col-12 col-lg-auto me-lg-auto mb-2 justify-content-center mb-md-0">
            <Link to="/" style={{ textDecoration: 'none' }}><li class="px-2 text-white" onclick="location.href='/'">QnA For Everyone</li></Link>
            </ul>

            <form class="col-12 col-lg-auto mb-3 mb-lg-0 me-lg-3" role="search">
            <input type="search" class="form-control form-control-dark text-bg-dark" placeholder="Search..." aria-label="Search"></input>
            </form>

            <div class="text-end">
            <Link to="/login" style={{ textDecoration: 'none' }}><button type="button" class="btn btn-outline-light me-2">Login</button></Link>
            <Link to="/register" style={{ textDecoration: 'none' }}><button type="button" class="btn btn-outline-light me-2">Register</button></Link>
            </div>
        </div>
        </div>
    </header>
    </div>
  );
}

export default Header;
